import { Route,Routes } from 'react-router-dom';
import Home from './Components/Pages/Home';
import Users from './Components/Pages/Users';


const MenuRoutes = () => {

    <Routes>
        <Route path='/' element={<Home/>}/>
        <Route path='users' element={<Users/>}/>
    </Routes>

}
export default MenuRoutes;
